1. Kiểm tra xem s1 có phải là một chuỗi con của s2 hay không.
2. Nếu không, ta sẽ kiểm tra xem chuỗi s1 có phải là một chuỗi con của chuỗi còn lại sau khi loại bỏ ký tự cuối cùng trong s2 không.
3. Nếu không, ta sẽ kiểm tra xem chuỗi s1 có phải là một chuỗi con của chuỗi còn lại sau khi loại bỏ ký tự đầu tiên trong s2 không.

Đây là mã Python để giải quyết bài toán này:

```python
def is_permutation_substring(s1, s2):
    if len(s1) > len(s2):
        return False

    if s1 == s2:
        return True

    if len(s2) == 0:
        return False

    if s1[0] == s2[0]:
        return is_permutation_substring(s1[1:], s2[1:])
    else:
        return is_permutation_substring(s1, s2[1:])
```

