To solve the given problem, we need to decode a string based on the rule: `k[encoded_string]`, where the `encoded_string` is repeated `k` times. Here's a C++ solution that addresses the problem:

```cpp
class Solution {
public:
    string decodeString(string s) {
        stack<int> numStack;
        stack<string> strStack;
        int n = s.size();
        int i = 0, num = 0;
        string str = "";

        while (i < n) {
            if (isdigit(s[i])) {
                num = num * 10 + (s[i] - '0');
            } else if (s[i] == '[') {
                numStack.push(num);
                strStack.push(str);
                num = 0;
                str = "";
            } else if (s[i] == ']') {
                string temp = str;
                for (int j = 0; j < numStack.top() - 1; j++) {
                    strStack.top() += temp;
                }
                numStack.pop();
                str = strStack.top();
                strStack.pop();
            } else {
                str += s[i];
            }
            i++;
        }

        return str;
    }
};
```

### Explanation:

1. **Stacks for Numbers and Strings**:
   - We use two stacks: `numStack` to store the numbers (multipliers) and `strStack` to store the substrings before the brackets.

2. **Iterate Through the String**:
   - We iterate through the string character by character.
   - If we encounter a digit, we build the number `num`.
   - If we encounter a `[`, we push the current number and substring into the respective stacks. We reset the number and substring for the new substring inside the brackets.
   - If we encounter a `]`, we pop the number from the `numStack` and the substring from the `strStack`. We then repeat the substring `num` times and add it to the current substring.
   - If we encounter any other character, we add it to the current substring.

3. **Return the Result**:
   - After processing the entire string, we return the decoded substring.

This solution handles the constraints and examples provided in the problem statement. It ensures that the decoded string is correct and efficient.

