struct uuid {
    u8 id[16];
};

static struct uuid *uuid;

/* 读取UUID的命令 */
static int read_uuid(struct nand_chip *chip) {
    struct mtd_info *mtd = chip->base.mtd;
    struct nand_ecc_chip *ecc_chip = &chip->ecc;
    struct uuid *uuid = mtd->priv;
    u8 cmd[2];
    int err;

    /* 设置命令和地址 */
    cmd[0] = CMD_READUUID;
    cmd[1] = 0x00;

    /* 执行读取命令 */
